import React, { Component } from 'react';

export default class AnnualGoals extends React.Component {

    constructor()
    {
        super();
    }

    buildList()
    {
        const ls_components = this.props.goals_list;

        return ls_components;
    }

    render() {  

        return (
            <div className="Annual_Goals">
                <h2>Annual Goals</h2>
            </div>
        )
    }
}
